//! The main module contains initialization tasks and user interaction.

extern crate pcap;
extern crate time;
#[macro_use] extern crate enum_primitive;
extern crate num;
#[macro_use] extern crate log;
extern crate simplelog;
extern crate rusqlite;
extern crate getopts;
