                        {
                            btnCall.Enabled = false;
                            btnHangUp.Enabled = true;
                            btnCall.BackColor = _disabledBtnColor;
                            btnHangUp.BackColor = _enabledBtnColor;
                            break;
                        }
                        case PhoneStatus.InCall:
                        {
                            btnCall.Enabled = false;
                            btnHangUp.Enabled = true;
                            btnCall.BackColor = _disabledBtnColor;
                            btnHangUp.BackColor = _enabledBtnColor;
                            break;
                        }
                        case PhoneStatus.IncomingCall:
