                            btnCall.Enabled = true;
                            btnHangUp.Enabled = true;
                            btnCall.BackColor = _enabledBtnColor;
                            btnHangUp.BackColor = _enabledBtnColor;
                            break;
                        }
                        case PhoneStatus.Registered:
                        {
                            btnCall.Enabled = true;
                            btnHangUp.Enabled = false;
                            btnCall.BackColor = _enabledBtnColor;
                            btnHangUp.BackColor = _disabledBtnColor;
                            break;
                        }
                    }
                }
            });
