    let (mut x, mut dx, mut out, mut dout) = arguments_grad(&backend, 10000);
    let mut func = || { let _ = backend.tanh_grad_plain(&mut x, &mut dx, &mut out, &mut dout); };
    { func(); bench_profile(b, func, 10); }
}
