  try {
    result = GetClient()->command("HLEN", _key);
  } catch (const runtime_error& error) {
    LOG(ERROR) << "Redis::GetEventsSinceId: " << error.what();
  }

  if (result.isError()) {
    LOG(ERROR) << "GET error: " << result.toString();
  }

  if (result.isOk()) {
    size = result.toInt();
  }

  return size;
}

