        {
            if(webFile.State == StateType.Error)
            {
                Downloading = false;
                ReadyToRender = false;
                errored = true;
                RequestPending = false;
                TileCache.RemoveFromQueue(this.Key, true);
            }
            else if(webFile.State == StateType.Received)
            {

                texReady = true;
                Downloading = false;
                errored = false;
