      val process = builder.start()
      new RedirectThread(process.getInputStream, printStream, "redirect R packaging").start()
      process.waitFor() == 0
    } catch {
      case e: Throwable =>
        print("Failed to build R package.", printStream, Level.SEVERE, e)
        false
    }
  }

