@test size(Aa) == (n+1, n2)
A, b = Aa[1:end-1,:], Aa[end:end,:]
@test_approx_eq X' * (Y1 .- b) (X'X + r) * A

aa = ridge(X, y1, r; trans=false, bias=true)
