	color: #333333;
}

#start, .main, #gameTime, #endBoard {
	margin: 0 auto;
	padding: 30px;
	text-align: center;
	width: 100%;
	height: auto;
}

#gameTime, #endBoard {
	display: none;

}

h1, h2 {
	display: inline-block;
}

.choose {
	font-family: 'Jim Nightshade', cursive;
	cursor: pointer;
}

.active {
	color: #7ACA99;
}
.board {
	width: 300px;
	height: 300px;
	margin: 0 auto;
}
