	font-family: 'Jim Nightshade', cursive;
	width: 100px;
	height: 100px;
	border: 2px solid #7ACA99;
	text-align: center;
	float: left;
	box-sizing: border-box;
	cursor: pointer;
	font-size: 50px;
	font-weight: bold;
	line-height: 100px;
}

.disabled {
