        case SCons(x, rt) =>
          SCons(x, $(rotateDrop(rt, i - 2, drop(2, f))))
      }
    }
  } ensuring(res => res.size == (r*).size + (f*).size - i &&
      res.isCons && time <= 300)

  def firstUneval[T](l: Lazy[Stream[T]]): Lazy[Stream[T]] = {
    if (l.isEvaluated) {
      l* match {
        case SCons(_, tail) =>
          firstUneval(tail)
