                result += 'e';
                if (esign)
                    result += esign;
                if (exponent.empty())
                    result += '0';
                else
                    result += exponent;
                return result;
            }

            Ustring float_fixed(long double x, int prec) {
                return float_print(x, prec, false);
            }

